      let closed =  document.querySelector(".closecarts")
      let shop = document.getElementById("shop")
 let overlay = document.querySelector(".overlay")

        closed.onclick  = ()=> {
          carts.style.transform = "translateX(100%)"
          overlay.style.visibility = "hidden"
        }
          shop.onclick = () => {
            carts.style.transform = "translateX(0%)" 
            overlay.style.visibility = "visible"
          }
         


              
  let itemsfilter = items
     let productDom = document.querySelector(".product")

     products(items)

function products(itemsfilter) {
    let i = 0
    // filterall.disabled = true
       productDom.innerHTML = ""  
        let result = ''
 itemsfilter.forEach((item) => {
     result +=`
       <div class="box">
      <img src= "${item.img}"  class="products-img" alt="img">
     <h1 class="title">  ${item.name} </h1> <div class="price"><p>$${item.price}<p></div>
     <button class="boxbtns" onclick="addtocart(${i++},${item.id})" >Add to Cart</button>
      </div>`
     // console.log (`${item.id}`)
            productDom.innerHTML  = result
 })  
}

let bars = document.getElementById("bars")
let media = document.querySelector(".display")
let close = document.querySelector(".closecart")
    bars.onclick = () => {
         
         media.style.transform = "translateX(0%)"
    } 

     close.onclick = () => {
   
      media.style.transform = "translateX(100%)"
     }


     
     let cart = []

     let leadsfromLocalstorage = JSON.parse( localStorage.getItem("cart") ) 
                
     if(leadsfromLocalstorage) {
    
     cart =  leadsfromLocalstorage
         displaycart()
     }


     // let  quantity = document.querySelector(".quantity")
     
     function addtocart(a,id)  {

       let incart = cart.find(items => items.id == id)

       if (incart) {
         
           alert("Product already added to Cart.")
                 a.disabled = true
       }
       else {
         
         cart.push({...itemsfilter[a]})
      carts.style.transform = "translateX(0%)" 
      console.log(cart)
      overlay.style.visibility = "visible"
    }
    
                displaycart() 
                       
      }

          

       function displaycart(a) {

                
          let results = ""
         
        
           if(cart.length == 0) {
             document.querySelector(".cartbox").innerHTML = `<h1>  Your Cart is Empty. </h1>`
             
           }
            else {
            
             cart.forEach((items,key) => {
                
               

                 if(items != null) {
                 localStorage.setItem("cart", JSON.stringify(cart))
                
                 
            results +=    `
                 <div class="cartcontent">
                  <img src="${items.img}">
                  <div class="detail">
                  <p class="name">${items.name} </p>
                  <p  class="price"> $ ${items.price} </p>
                  <div class="quantities">
                  <p> Quantity </p>
                <input type="number" value="1"  class="quantity" min="1" required>
                </div>
                   </div>
                   <div class ="btnsnum">

                   <i onclick="cancel(${key},${items.id})" class="fa fa-trash" ></i>
                 
                  
                     </div>
                </div>
                
                `
        
                 }
                
        
                 document.querySelector(".cartbox").innerHTML = results
              
               })
              
            }
           
        updatetotal()
        let quantitychange = document.getElementsByClassName("quantity")
        for(i=0; i<quantitychange.length; i++) {
            inputs = quantitychange[i]
             inputs.addEventListener("change", quantitychanged)
        }
                   
        function quantitychanged(e) {
         let  input =  e.target
          if(isNaN((input.value))){
             input.value = 1
          }
           
           updatetotal()
       }
          
       }
      

       function clears() {
        cart = []
        localStorage.removeItem("cart")
         localStorage.removeItem("totalprice")
         displaycart()
       }

       
     
   
       function updatetotal(){
        let cartbox = document.getElementsByClassName("cartbox")[0]
       let cartcontent =  cartbox.getElementsByClassName("cartcontent")
       let totalprice = 0
         for(i=0; i<cartcontent.length; i++){

             let  cartboxes = cartcontent[i]

           let cartPrice = cartboxes.getElementsByClassName("price")[0]
           let cartquantity =  cartboxes.getElementsByClassName("quantity")[0]
         
            let  price = parseFloat( cartPrice.innerHTML.replace("$", ""))
            
              quantity = cartquantity.value
          console.log(quantity)
             totalprice =  totalprice + price * quantity
             
         }
         localStorage.setItem("totalprice", JSON.stringify(totalprice))
             totals.innerText = "$" + totalprice.toLocaleString()
 
    }
     

       let buybtn = document.getElementById("buys")
        window.onload = ()=> {    
       buybtn.addEventListener("click", ()=> {
        if (totals.innerHTML == `$0`)  {

          alert("No Products in cart")
    
        }

        else {
      
       document.location = "form.html"
        }
       
       })
     }
       


                 function cancel(a) {
               
                   cart.splice(a,1)
                  
                    
                   displaycart()
                   updatetotal()
                    localStorage.setItem("cart", JSON.stringify(cart))
                 
               }

              

               function showname() {
                 let nameinput = document.getElementById("nameinput").value
                    // let productDom = document.querySelector("#product")
                    
                 itemsfilter = items.filter(item => {
                 
                  if(nameinput != '') {
                   
                     if(!item.name.includes(nameinput.toUpperCase())){
                           
                         return false  
                     }
                     
                  }
                   return true

              })
              products(itemsfilter)
               }
                let filterall = document.getElementById("all")
               filterall.addEventListener("click", allclicked)
               function allclicked(e) {
                let valueFilter =  e.target.dataset.filter
                
                itemsfilter = items.filter((item ) => {
                 
                     if(valueFilter != '') {
                        if(item.nature.all != valueFilter){
                            
                            return false
                        }
                     }
                      return true
                 })
                 products(itemsfilter)
               
               }
      
                 let query = document.querySelectorAll(".filter li")
                  for(i=0; i<query.length; i++) {
                    queries  = query[i]
                  queries.addEventListener("click", filter)
                  }
               function filter(e) {
              
              let valueFilter = e.target.dataset.filter
                
                itemsfilter = items.filter((item ) => {
                 
                  if(valueFilter != ''){
                        if(item.nature.category != valueFilter){
                            
                            return false
                        }
                      }
                      return true
                 })
                 products(itemsfilter)
               
               }
                let closes = document.querySelector(".close")
                 let modal = document.querySelector(".modals")
              let bar = document.getElementById("bar")
                closes.onclick=()=> {
                   modal.style.display = "none"
                }
                bar.onclick=()=> {
                  modal.style.display = "block"
               }

               let alls = document.getElementById("alls")
              alls.addEventListener("click", all)
               function all(e) {
                let valueFilter =  e.target.dataset.filter
                
                itemsfilter = items.filter((item ) => {
                 
                     if(valueFilter != '') {
                        if(item.nature.all != valueFilter){
                            
                            return false
                        }
                     }
                      return true
                 })
                 products(itemsfilter)
               
               }
      
               let modals = document.querySelectorAll(".list li")
                  for(i=0; i<modals.length; i++) {
                  
                  modals[i].addEventListener("click", filters)
                  }
               function filters(e) {
              
              let valueFilter = e.target.dataset.filter
                
                itemsfilter = items.filter((item ) => {
                 
                  if(valueFilter != ''){
                        if(item.nature.category != valueFilter){
                            
                            return false
                        }
                      }
                      return true
                 })
                 products(itemsfilter)
               
               }
            